import React from 'react';




const Title = props => {
    var cur = new Date();
    var last = new Date(cur.getTime() - (4 * 24 * 60 * 60 * 1000 + 11 * 60 * 60 * 1000)).toString();
    cur = cur.getDay().toString();
return (<h2>{last} - {cur}</h2>)
}
export default Title;
